import React, { useEffect, useRef } from 'react';
import Svg, { Line, Defs, Pattern, Rect } from 'react-native-svg';
import { View, StyleSheet, Animated, Easing } from 'react-native';

const GridBackground = () => {
  const fadeAnim = useRef(new Animated.Value(0.4)).current;
  const translateX1 = useRef(new Animated.Value(0)).current;
  const translateX2 = useRef(new Animated.Value(0)).current;
  const translateY1 = useRef(new Animated.Value(0)).current;
  const translateY2 = useRef(new Animated.Value(0)).current;

  useEffect(() => {
    // Breathing effect
    Animated.loop(
      Animated.sequence([
        Animated.timing(fadeAnim, {
          toValue: 0.7,
          duration: 3000,
          easing: Easing.inOut(Easing.sine),
          useNativeDriver: true,
        }),
        Animated.timing(fadeAnim, {
          toValue: 0.4,
          duration: 3000,
          easing: Easing.inOut(Easing.sine),
          useNativeDriver: true,
        })
      ])
    ).start();

    // Continuous horizontal movements
    Animated.loop(
      Animated.timing(translateX1, {
        toValue: -200,
        duration: 20000,
        easing: Easing.linear,
        useNativeDriver: true,
      })
    ).start();

    Animated.loop(
      Animated.timing(translateX2, {
        toValue: 200,
        duration: 25000,
        easing: Easing.linear,
        useNativeDriver: true,
      })
    ).start();

    // Continuous vertical movements
    Animated.loop(
      Animated.timing(translateY1, {
        toValue: -200,
        duration: 30000,
        easing: Easing.linear,
        useNativeDriver: true,
      })
    ).start();

    Animated.loop(
      Animated.timing(translateY2, {
        toValue: 200,
        duration: 35000,
        easing: Easing.linear,
        useNativeDriver: true,
      })
    ).start();
  }, []);

  return (
    <View style={styles.container}>
      {/* Base layer - large grid moving diagonally */}
      <Animated.View 
        style={[
          styles.overlay, 
          { 
            opacity: fadeAnim,
            transform: [
              { translateX: translateX1 },
              { translateY: translateY1 }
            ]
          }
        ]}
      >
        <Svg height="200%" width="200%" style={styles.grid}>
          <Defs>
            <Pattern 
              id="grid3" 
              width="200" 
              height="200" 
              patternUnits="userSpaceOnUse"
              patternTransform="rotate(15)"
            >
              <Line
                x1="0"
                y1="200"
                x2="200"
                y2="200"
                stroke="#F4E409"
                strokeWidth="1"
                strokeOpacity="0.3"
              />
              <Line
                x1="200"
                y1="0"
                x2="200"
                y2="200"
                stroke="#F4E409"
                strokeWidth="1"
                strokeOpacity="0.3"
              />
            </Pattern>
          </Defs>
          <Rect width="200%" height="200%" fill="url(#grid3)" x="-50%" y="-50%" />
        </Svg>
      </Animated.View>

      {/* Middle layer - medium grid moving opposite direction */}
      <Animated.View 
        style={[
          styles.overlay, 
          { 
            opacity: fadeAnim,
            transform: [
              { translateX: translateX2 },
              { translateY: translateY2 }
            ]
          }
        ]}
      >
        <Svg height="200%" width="200%" style={styles.grid}>
          <Defs>
            <Pattern 
              id="grid2" 
              width="100" 
              height="100" 
              patternUnits="userSpaceOnUse"
              patternTransform="rotate(-15)"
            >
              <Line
                x1="0"
                y1="100"
                x2="100"
                y2="100"
                stroke="#B8860B"
                strokeWidth="0.5"
                strokeOpacity="0.4"
              />
              <Line
                x1="100"
                y1="0"
                x2="100"
                y2="100"
                stroke="#B8860B"
                strokeWidth="0.5"
                strokeOpacity="0.4"
              />
            </Pattern>
          </Defs>
          <Rect width="200%" height="200%" fill="url(#grid2)" x="-50%" y="-50%" />
        </Svg>
      </Animated.View>

      {/* Top layer - finest grid with diagonal movement */}
      <Animated.View 
        style={[
          styles.overlay, 
          { 
            opacity: fadeAnim,
            transform: [
              { translateX: Animated.multiply(translateX1, 0.5) },
              { translateY: Animated.multiply(translateY2, 0.5) }
            ]
          }
        ]}
      >
        <Svg height="200%" width="200%" style={styles.grid}>
          <Defs>
            <Pattern 
              id="grid1" 
              width="50" 
              height="50" 
              patternUnits="userSpaceOnUse"
              patternTransform="rotate(30)"
            >
              <Line
                x1="0"
                y1="50"
                x2="50"
                y2="50"
                stroke="#DAA520"
                strokeWidth="0.3"
                strokeOpacity="0.5"
              />
              <Line
                x1="50"
                y1="0"
                x2="50"
                y2="50"
                stroke="#DAA520"
                strokeWidth="0.3"
                strokeOpacity="0.5"
              />
            </Pattern>
          </Defs>
          <Rect width="200%" height="200%" fill="url(#grid1)" x="-50%" y="-50%" />
        </Svg>
      </Animated.View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    zIndex: -1,
    overflow: 'hidden',
  },
  overlay: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
  },
  grid: {
    position: 'absolute',
    top: 0,
    left: 0,
  },
});

export default GridBackground;
